INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60000, 1, 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60000, 2, 1, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 2, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60000, 2, 1, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 3, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60000, 2, 2, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 4, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60000, 2, 1, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 5, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60000, 2, 1, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 6, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60000, 2, 2, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 7, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60000, 2, 1, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 8, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60000, 2, 1, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 9, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60000, 2, 1, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 10, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60000, 2, 1, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 11, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60000, 2, 2, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 12, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60000, 2, 1, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 13, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60000, 2, 1, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 14, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60000, 2, 1, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 15, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60000, 2, 1, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 16, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60000, 2, 2, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 17, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60000, 3, 0, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 18, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60000, 3, 0, 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 19, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ハツネ", 101201, 80001, 0, 0, 1, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 20, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ハツネ", 101201, 80001, 0, 0, 1, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 21, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シオリ", 103801, 80001, 1, 0, 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 22, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シオリ", 103801, 80001, 1, 0, 1, "来年も、\n一緒にいられたら…\nうれしいな", 23, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キョウカ", 103601, 80001, 0, 0, 2, "あなたと一緒にいるようになって、\nもう1年ですか…", 24, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キョウカ", 103601, 80001, 0, 0, 2, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 25, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ミミ", 102001, 80001, 1, 0, 2, "おにいちゃんとあってから、\n1年たったよ～！", 26, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ミミ", 102001, 80001, 1, 0, 2, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 27, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ミソギ", 100401, 80001, 2, 0, 2, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 28, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ミソギ", 100401, 80001, 2, 0, 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 29, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "マホ", 101001, 80001, 0, 0, 3, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 30, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "マホ", 101001, 80001, 0, 0, 3, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 31, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "イリヤ", 104401, 80001, 1, 0, 3, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 32, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "イリヤ", 104401, 80001, 1, 0, 3, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 33, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カオリ", 101701, 80001, 2, 0, 3, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 34, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カオリ", 101701, 80001, 2, 0, 3, "これからも、どうぞよろしく\nお願いするさ～！", 35, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "サレン", 102801, 80001, 0, 0, 4, "あんたと出会ってからもうそんなに\nたつのね～", 36, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "サレン", 102801, 80001, 0, 0, 4, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 37, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "スズメ", 102501, 80001, 1, 0, 4, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 38, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "スズメ", 102501, 80001, 1, 0, 4, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 39, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "タマキ", 104601, 80001, 0, 0, 5, "振り返れば、今までいろんなことが\nあったにゃあ…", 40, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "タマキ", 104601, 80001, 0, 0, 5, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 41, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ミフユ", 104801, 80001, 1, 0, 5, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 42, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ミフユ", 104801, 80001, 1, 0, 5, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 43, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "アキノ", 103201, 80001, 0, 0, 6, "あなたさまと出会ってもう1年…", 44, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "アキノ", 103201, 80001, 0, 0, 6, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 45, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ユカリ", 103401, 80001, 1, 0, 6, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 46, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ユカリ", 103401, 80001, 1, 0, 6, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 47, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "クリスティーナ", 107101, 80001, 0, 0, 7, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 48, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "クリスティーナ", 107101, 80001, 0, 0, 7, "ともかくこれからも\n愉しませてくれよ☆", 49, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ジュン", 104701, 80001, 1, 0, 7, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 50, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ジュン", 104701, 80001, 1, 0, 7, "見えないから分からないって？\nそれもそうだな…", 51, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "トモ", 103701, 80001, 0, 0, 8, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 52, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "トモ", 103701, 80001, 0, 0, 8, "これからもよろしくね！", 53, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "マツリ", 100501, 80001, 1, 0, 8, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 54, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "マツリ", 100501, 80001, 1, 0, 8, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 55, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ミヤコ", 100701, 80001, 0, 0, 9, "オマエと会って1年なの！\n全然成仏もできなかったし、", 56, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ミヤコ", 100701, 80001, 0, 0, 9, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 57, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シノブ", 103101, 80001, 1, 0, 9, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 58, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シノブ", 103101, 80001, 1, 0, 9, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 59, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "アンナ", 100901, 80001, 0, 0, 10, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 60, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "アンナ", 100901, 80001, 0, 0, 10, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 61, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ナナカ", 101301, 80001, 1, 0, 10, "君と出会ってもう1年だって！\n早いねー！", 62, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ナナカ", 101301, 80001, 1, 0, 10, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 63, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ミツキ", 105101, 80001, 0, 0, 11, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 64, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ミツキ", 105101, 80001, 0, 0, 11, "これからも、いろんなところを\n調べさせてね？", 65, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ルカ", 105601, 80001, 1, 0, 11, "お前さんと出会ってもう1年か\n助太刀するつもりが", 66, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ルカ", 105601, 80001, 1, 0, 11, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 67, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "エリコ", 102701, 80001, 2, 0, 11, "早いものですわね、あなた様と\nお会いして、もう1年…", 68, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "エリコ", 102701, 80001, 2, 0, 11, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 69, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "アヤネ", 102301, 80001, 0, 0, 12, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 70, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "アヤネ", 102301, 80001, 0, 0, 12, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 71, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "チカ", 104201, 80001, 1, 0, 12, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 72, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "チカ", 104201, 80001, 1, 0, 12, "私のことを見守ってください\nできることなら、ずっと…", 73, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "クルミ", 102101, 80001, 2, 0, 12, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 74, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "クルミ", 102101, 80001, 2, 0, 12, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 75, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シズル", 104901, 80001, 0, 0, 13, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 76, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シズル", 104901, 80001, 0, 0, 13, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 77, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "リノ", 101101, 80001, 1, 0, 13, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 78, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "リノ", 101101, 80001, 1, 0, 13, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 79, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ユイ", 100201, 80001, 0, 0, 14, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 80, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ユイ", 100201, 80001, 0, 0, 14, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 81, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ヒヨリ", 100101, 80001, 1, 0, 14, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 82, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ヒヨリ", 100101, 80001, 1, 0, 14, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 83, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "レイ", 100301, 80001, 2, 0, 14, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 84, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "レイ", 100301, 80001, 2, 0, 14, "キミに背中を預けられる日が、\n早くきますように", 85, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80001, 0, 0, 15, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 86, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80001, 0, 0, 15, "これからもずっと、覚えていて\nくださいね！", 87, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80001, 1, 0, 15, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 88, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80001, 1, 0, 15, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 89, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80001, 2, 0, 15, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 90, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80001, 2, 0, 15, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 91, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "スズメ", 112101, 60001, 1, 1, 0, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 92, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 93, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 94, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 95, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 96, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60001, 2, 2, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 97, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 98, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 99, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 100, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 101, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60001, 2, 2, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 102, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 103, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 104, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 105, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 106, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 107, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 108, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60001, 2, 2, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 109, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 110, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 111, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 112, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 113, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 114, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60001, 2, 1, 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 115, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60001, 2, 2, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 116, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "スズメ", 112101, 60001, 3, 0, 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 117, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "スズメ", 112101, 60001, 3, 0, 7, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 118, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 1, "ヒューヒュー♪\nドンドンパフパフー♪", 119, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 120, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 1, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 121, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 1, "え？　ちょっと\nいきなりなにっ？", 122, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 1, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 123, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 1, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 124, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 1, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 125, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 1, "ですからその日に向けて\n今から気分を盛り上げているのです", 126, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 1, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 127, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 1, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 128, "", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 1, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 129, "", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 1, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 130, "", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 1, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 131, "", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 2, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 132, "", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 1, 0, 2, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 133, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 2, "げっ…カリンじゃない\nなんでもないわよ！", 134, "", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 1, 0, 2, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 135, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 2, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 136, "", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 1, 0, 2, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 137, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 2, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 138, "", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 2, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 139, "", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 1, 0, 2, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 140, "", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 2, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 141, "", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 1, 0, 2, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 142, "", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 2, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 143, "", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 3, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 144, "", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 1, 0, 3, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 145, "", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 3, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 146, "", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 3, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 147, "", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 1, 0, 3, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 148, "", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 1, 0, 3, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 149, "", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 3, "あとは、牧場に素敵な温泉が\n出来たとか…", 150, "", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 1, 0, 3, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 151, "", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 3, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 152, "", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 1, 0, 3, "えへへ、ありがとうございます\nコッコロちゃん！", 153, "", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 3, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 154, "", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 1, 0, 3, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 155, "", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 4, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 156, "", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 1, 0, 4, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 157, "", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 4, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 158, "", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 1, 0, 4, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 159, "", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 4, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 160, "", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 1, 0, 4, "…積極的？\nなんの話よ？", 161, "", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 4, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 162, "", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 4, "ムーサの町で\nきゃるきゃる～ん☆　って！", 163, "", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 1, 0, 4, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 164, "", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 4, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 165, "", 16);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 1, 0, 4, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 166, "", 16);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 1, 0, 4, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 167, "", 17);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 5, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 168, "", 18);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 5, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 169, "", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 5, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 170, "", 19);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 5, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 171, "", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 5, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 172, "", 20);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 5, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 173, "", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 5, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 174, "", 21);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 5, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 175, "", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 5, "かくし芸？", 176, "", 22);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 5, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 177, "", 16);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 5, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 178, "", 23);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 6, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 179, "", 17);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 6, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 180, "", 24);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 6, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 181, "", 17);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 6, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 182, "", 18);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 6, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 183, "", 25);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 6, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 184, "", 18);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 6, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 185, "", 26);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 6, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 186, "", 27);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 6, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 187, "", 28);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 6, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 188, "", 19);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 6, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 189, "", 19);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 6, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 190, "", 29);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 7, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 191, "", 30);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 7, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 192, "", 31);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 7, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 193, "", 32);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 7, "あー\nあー\n…声、これで大丈夫かしら？", 194, "", 33);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 7, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 195, "", 34);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 7, "オイッスー☆", 196, "", 35);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 7, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 197, "", 36);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 7, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 198, "", 37);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 7, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 199, "", 38);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 8, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 200, "", 20);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 8, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 201, "", 21);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 8, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 202, "", 22);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 8, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 203, "", 23);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 8, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 204, "", 24);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 8, "オイッスー☆", 205, "", 25);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 8, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 206, "", 26);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 8, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 207, "", 27);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 0, 0, 8, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 208, "", 28);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 9, "オイッスー☆", 209, "", 20);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 9, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 210, "", 21);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 9, "あと６日で2.5周年ですか…", 211, "", 22);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 9, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 212, "", 23);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 9, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 213, "", 24);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 9, "オイッスー☆", 214, "", 25);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 9, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 215, "", 26);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 9, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 216, "", 27);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 9, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 217, "", 28);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 9, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 218, "", 29);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 9, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 219, "", 30);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 10, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 220, "", 31);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 10, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 221, "", 29);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 10, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 222, "", 32);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 10, "…………", 223, "", 39);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 10, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 224, "", 30);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 10, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 225, "", 40);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 10, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 226, "", 33);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 10, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 227, "", 41);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 10, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 228, "", 34);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 10, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 229, "", 35);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 10, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 230, "", 42);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 10, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 231, "", 31);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 10, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 232, "", 43);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 10, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 233, "", 36);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 11, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 234, "", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 11, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 235, "", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 11, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 236, "", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 11, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 237, "", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 11, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 238, "", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 11, "次にコッコロさんですが\nこちらは発声練習をしています", 239, "", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 11, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 240, "", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 11, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 241, "", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 11, "あれ？\nもしかして緊張で気を失って…？", 242, "", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 11, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 243, "", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 11, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 244, "", 16);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 11, "それでは\nまた明日お会いしましょう♪", 245, "", 17);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 12, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 246, "", 44);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 2, 0, 12, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 247, "", 37);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 12, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 248, "", 32);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 12, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 249, "", 45);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 2, 0, 12, "ひどいですよぉキャルちゃ～ん！", 250, "", 38);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 12, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 251, "", 33);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 2, 0, 12, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 252, "", 39);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 0, 0, 12, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 253, "", 46);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 12, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 254, "", 34);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 2, 0, 12, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 255, "", 40);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 13, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 256, "", 41);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 13, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 257, "", 47);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 13, "忘れてきちゃいました☆", 258, "", 42);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 13, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 259, "", 48);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 13, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 260, "", 35);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 13, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 261, "", 49);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 13, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 262, "", 43);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 13, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 263, "", 50);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 13, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 264, "", 36);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 13, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 265, "", 51);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 13, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 266, "", 37);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 13, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 267, "", 52);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 13, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 268, "", 44);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 13, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 269, "", 38);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 13, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 270, "", 45);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 13, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 271, "", 53);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 13, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 272, "", 46);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 14, "こんにちは\n【ギルド管理協会】のカリンです", 273, "", 18);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 14, "昨日の生放送は\nいかがだったでしょうか？", 274, "", 19);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 14, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 275, "", 20);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 14, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 276, "", 21);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 14, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 277, "", 22);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 14, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 278, "", 23);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 14, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 279, "", 24);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 14, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 280, "", 25);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 14, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 281, "", 26);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80003, 0, 0, 14, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 282, "", 27);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 15, "準備はいいですかっ？\n…いっきますよー！", 283, "", 47);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 15, "祝！", 284, "", 54);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 15, "2.5周年！", 285, "", 39);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 15, "おめでとうございま～す☆", 286, "", 48);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 15, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 287, "", 55);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 15, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 288, "", 40);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 15, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 289, "", 49);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 15, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 290, "", 56);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 15, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 291, "", 41);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 15, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 292, "", 57);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 15, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 293, "", 50);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 15, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 294, "", 58);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 15, "記念日だから\n平気平気♪\nやばいですね☆", 295, "", 51);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 15, "意味分かんないわよ！", 296, "", 59);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 15, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 297, "", 42);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 15, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 298, "", 43);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 15, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 299, "", 52);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80003, 2, 0, 15, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 300, "", 60);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80003, 1, 0, 15, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 301, "", 44);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80003, 0, 0, 15, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 302, "", 53);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "ペコリーヌ・コッコロ・キャル", 105801, 80003, 0, 0, 15, "2.5周年\nありがとうございます！", 303, "105901,45,106001,61", 54);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60002, 1, 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 304, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 305, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 306, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 307, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 308, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60002, 2, 2, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 309, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 310, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 311, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 312, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 313, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60002, 2, 2, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 314, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 315, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 316, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 317, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 318, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 319, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 320, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60002, 2, 2, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 321, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 322, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 323, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 324, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 325, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 326, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60002, 2, 1, 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 327, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60002, 2, 2, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 328, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60002, 3, 0, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 329, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60002, 3, 0, 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 330, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 4, 0, 1, "ささ、シェフィさまはこちらへ…", 331, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 1, "コッコロさん、どこへ行くの…？\n…え？", 332, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 1, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 333, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 4, 0, 1, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 334, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 1, "ええと…\n二人とも何をしているの？", 335, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 336, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 1, "あの日…？", 337, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 1, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 338, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 1, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 339, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 1, "やばいですね☆", 340, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 1, "って、なにしれっと\n参加してんのよカリン！", 341, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 1, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 342, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 1, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 343, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 1, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 344, "", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 1, "えっ！？　ええとええと…！\nあ、あと14日…！", 345, "", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 2, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 346, "", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 2, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 347, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 2, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 348, "", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 2, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 349, "", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 2, "さすがでございます\nペコリーヌさま", 350, "", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 2, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 351, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 2, "しゃなり、しゃなり…\nふふ、案外できるものね", 352, "", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 2, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 353, "", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 2, "さ、次はキャルさまの\n番でございますよ", 354, "", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 2, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 355, "", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 2, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 356, "", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 2, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 357, "", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 2, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 358, "", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 2, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 359, "", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 2, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 360, "", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 3, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 361, "", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 3, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 362, "", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 3, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 363, "", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 3, "聖学祭…って、なにかしら？", 364, "", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 3, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 365, "", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 3, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 366, "", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 3, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 367, "", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 3, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 368, "", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 3, "いや、そのまんますぎでしょ…", 369, "", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 3, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 370, "", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 3, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 371, "", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 3, "えっ？　ええ…\nぎゅーっ…？", 372, "", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 4, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 373, "", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 4, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 374, "", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 4, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 375, "", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 4, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 376, "", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 4, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 377, "", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 4, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 378, "", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 4, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 379, "", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 4, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 380, "", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 4, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 381, "", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 4, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 382, "", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 4, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 383, "", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 4, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 384, "", 16);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 4, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 385, "", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 5, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 386, "", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 5, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 387, "", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 5, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 388, "", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 5, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 389, "", 17);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 5, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 390, "", 18);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 5, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 391, "", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 5, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 392, "", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 5, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 393, "", 16);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 5, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 394, "", 19);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 5, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 395, "", 17);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 5, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 396, "", 18);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 5, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 397, "", 19);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 6, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 398, "", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 6, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 399, "", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 6, "…えっ！？", 400, "", 20);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 6, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 401, "", 20);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 6, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 402, "", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 4, 0, 6, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 403, "", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 6, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 404, "", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 6, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 405, "", 21);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 6, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 406, "", 21);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 6, "ぶっ殺すぞ！？", 407, "", 22);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 6, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 408, "", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 7, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 409, "", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 7, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 410, "", 23);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 7, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 411, "", 16);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 7, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 412, "", 22);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 7, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 413, "", 24);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 7, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 414, "", 17);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 7, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 415, "", 16);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 7, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 416, "", 18);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 7, "もちろんでございます\n仲良くお勉強いたしましょう", 417, "", 17);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 7, "しれっと教育ママが\n生まれてる…？", 418, "", 25);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 7, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 419, "", 23);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 7, "え～～～～！？", 420, "", 26);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 8, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 421, "", 27);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 8, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 422, "", 19);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 8, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 423, "", 18);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 8, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 424, "", 24);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 8, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 425, "", 20);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 8, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 426, "", 28);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 8, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 427, "", 19);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 8, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 428, "", 21);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 8, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 429, "", 29);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 8, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 430, "", 30);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 8, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 431, "", 25);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 8, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 432, "", 31);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 9, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 433, "", 22);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 9, "…えっ？\n生放送の意気込み！？\n突然なに！？", 434, "", 23);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 9, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 435, "", 24);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 9, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 436, "", 25);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 9, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 437, "", 26);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 9, "それから、それから…！\nぅ、ぅぅっ…！", 438, "", 27);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 9, "―びえぇぇ～んっ！！！", 439, "", 28);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 9, "どうされましたか、シェフィさま", 440, "", 20);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 9, "ううっ…ひっく…\nママッ…！", 441, "", 29);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 9, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 442, "", 21);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 9, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 443, "", 22);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 9, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 444, "", 30);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 0, 0, 10, "主さま\n3.5周年まであと５日\nでございます", 445, "", 23);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 0, 0, 10, "ですがその前に\n生放送がありますね", 446, "", 24);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 0, 0, 10, "…生放送に向けた\n意気込みでございますか？", 447, "", 25);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 0, 0, 10, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 448, "", 26);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 0, 0, 10, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 449, "", 27);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 0, 0, 10, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 450, "", 28);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 0, 0, 10, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 451, "", 29);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 0, 0, 10, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 452, "", 30);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 0, 0, 10, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 453, "", 31);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 0, 0, 11, "3.5周年まであと４日！\nやばいですね☆", 454, "", 26);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 11, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 455, "", 32);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 0, 0, 11, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 456, "", 27);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 0, 0, 11, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 457, "", 28);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 0, 0, 11, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 458, "", 29);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 11, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 459, "", 33);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 0, 0, 11, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 460, "", 30);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 0, 0, 11, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 461, "", 31);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 0, 0, 11, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 462, "", 32);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 11, "だからあたしはやるなんて一言も…", 463, "", 34);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 0, 0, 11, "オイッスー☆", 464, "", 33);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 11, "聞きなさいっての！！", 465, "", 35);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 12, "3.5周年まであと３日…\nそして生放送は、明日…", 466, "", 31);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 12, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 467, "", 32);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 12, "おいっす！\n…こうじゃなかったわね\nええと確か…", 468, "", 33);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 12, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 469, "", 34);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 12, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 470, "", 35);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 12, "やってますねシェフィちゃん！", 471, "", 34);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 12, "なによ、考えることは\nみんな同じってこと？", 472, "", 36);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 12, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 473, "", 32);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 12, "みんな…もちろんよ！", 474, "", 36);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 12, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 475, "", 35);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 13, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 476, "", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 13, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 477, "", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 13, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 478, "", 36);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 13, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 479, "", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 4, 0, 13, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 480, "", 33);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 13, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 481, "", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 13, "大丈夫…大丈夫…\nあたしは大丈夫…", 482, "", 37);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 13, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 483, "", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 13, "あうー？", 484, "", 37);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "みんな", 105801, 80005, 4, 0, 13, "あ…", 485, "105901,34,106001,38,190801,12", 37);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 13, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 486, "", 39);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 4, 0, 13, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 487, "", 35);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 13, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 488, "", 38);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 13, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 489, "", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 14, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 490, "", 38);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 14, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 491, "", 39);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 14, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 492, "", 40);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 14, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 493, "", 36);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 14, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 494, "", 39);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 14, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 495, "", 40);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 1, 0, 14, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 496, "", 37);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 0, 0, 14, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 497, "", 41);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 14, "へ、へぇ…", 498, "", 40);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 14, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 499, "", 41);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 14, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 500, "", 41);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 2, 0, 14, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 501, "", 42);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 15, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 502, "", 42);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 15, "祝！", 503, "", 42);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 4, 0, 15, "3.5周年！", 504, "", 38);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 15, "おめでとうございます！", 505, "", 43);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 15, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 506, "", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190801, 80005, 2, 0, 15, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 507, "", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 15, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 508, "", 43);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 15, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 509, "", 44);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 15, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 510, "", 43);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "キャル", 106001, 80005, 1, 0, 15, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 511, "", 44);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 15, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 512, "", 44);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "シェフィ", 106401, 80005, 0, 0, 15, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 513, "", 45);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 4, 0, 15, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 514, "", 39);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 4, 0, 15, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 515, "", 40);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "コッコロ", 105901, 80005, 4, 0, 15, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 516, "", 41);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "ペコリーヌ", 105801, 80005, 3, 0, 15, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 517, "", 45);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "みんな", 105801, 80005, 4, 0, 15, "これからも\nよろしくおねがいします！", 518, "105901,42,106001,45,106401,46,190801,16", 46);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60003, 1, 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 519, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 520, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 521, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 522, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 523, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60003, 2, 2, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 524, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 525, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 526, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 527, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 528, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60003, 2, 2, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 529, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 530, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 531, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 532, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 533, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 534, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 535, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60003, 2, 2, 0, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 536, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 537, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 538, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 539, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 540, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 541, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60003, 2, 1, 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 542, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60003, 2, 2, 0, "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 543, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60003, 3, 0, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 544, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60003, 3, 0, 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 545, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60004, 1, 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 546, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 547, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 548, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は姫吉！　宴でも開きたくなるほどの絶対幸運！\nイメチェンでもしてみるのはどうだ？　ぴょんぴょん、なんてな♪", 549, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は姫吉！　ずっと祈り続けていた願いが叶うかも！\nきっとあんたならたどり着けるわ、ハッピーエンドのその先に", 550, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 551, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 552, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60004, 2, 2, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 553, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は大吉！　ラッキーワードは「ぴょんぴょん♪」\nおっきな声で一緒に言ってみよ～♪　うさぎさんぴょんぴょ～ん♪", 554, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は大吉！　あなたの趣味がもっと広がるかも！\nかんわゆ～～～いショタと～騎士きゅんもゲット～んふふ～♪", 555, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 556, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 557, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60004, 2, 2, 0, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 558, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 559, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 560, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は中吉！　健康に気を遣って気持ちのいい一年を！\n体に不調があるときは遠慮なく言いなさい、隅々まで調べてあげる", 561, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は中吉！　歌を口ずさみ、幸運を呼び込もう！\n幸運になれるかは分からないけど……一緒に、歌いましょ？", 562, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は中吉！　誰かに尽くすことで掴める幸せもあるかも？\n人事を尽くして天命を待つ！　さ、年始もバリバリ働きますわよ♪", 563, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 564, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 565, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 566, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60004, 2, 2, 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 567, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 568, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60004, 2, 1, 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 569, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60004, 2, 2, 0, "今日の運勢は小吉！　小さな勇気で踏み出す一歩が大事！\n遠くから見てるだけじゃダメ。今日は、少しだけ近づいてみます！", 570, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60004, 3, 0, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 571, "", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60004, 3, 0, 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 572, "", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60005, 1, 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 573, "", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 574, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は姫吉！　ずっと祈り続けていた願いが叶うかも！\nきっとあんたならたどり着けるわ、ハッピーエンドのその先に", 575, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60005, 2, 2, 0, "今日の運勢は姫吉！　道を歩けば幸運に当たる、最高の吉日！　　さすがは兄様。尽善尽美、金甌無欠の強運をお持ちですね。", 576, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60005, 2, 2, 0, "今日の運勢は姫吉！　旅立ち、どこへ行くもよし！　　　　　　　新年の門出も、お兄さんと一緒です♪　冒険にしゅっぱーつ♪", 577, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, 60005, 2, 2, 0, "今日の運勢は姫吉！　一日三食食べれば健康運アップ！　　　　　おせち。おぞうに。もっと、たべよ？　お兄。", 578, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は大吉！　あなたの趣味がもっと広がるかも！\nかんわゆ～～～いショタと～騎士きゅんもゲット～んふふ～♪", 579, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 580, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は大吉！　日々の努力が実り、何事も良い方向へ！　　そんな弟くんには、お姉ちゃんのよしよしぎゅ～っをプレゼント♪", 581, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60005, 2, 2, 0, "今日の運勢は大吉！　お出かけするといいことあるかも？　　　　また一緒に、お忍びデートしてくださいね……騎士♪", 582, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, 60005, 2, 2, 0, "今日の運勢は大吉！　転居するならあたたかい場所が吉！　　　　煉獄の世なれど、住めば都と申しんす。ゆるりときなんせ……♪", 583, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 584, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は中吉！　誰かに尽くすことで掴める幸せもあるかも？\n人事を尽くして天命を待つ！　さ、年始もバリバリ働きますわよ♪", 585, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は中吉！　歌を口ずさみ、幸運を呼び込もう！\n幸運になれるかは分からないけど……一緒に、歌いましょ？", 586, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は中吉！　健康に気を遣って気持ちのいい一年を！\n体に不調があるときは遠慮なく言いなさい、隅々まで調べてあげる", 587, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 588, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60005, 2, 2, 0, "今日の運勢は中吉！　争いごとは勝つが油断は大敵！　　　　　　ま、このあたしと一緒なら、向かうところ敵はねーですよっ！", 589, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 0, "", 0, 60005, 2, 2, 0, "今日の運勢は中吉！　ラッキーアイテムは「光るもの」！　　　　ハツネちゃんの「きらーんっ☆」な魔法、見せちゃおうかなっ？", 590, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は小吉！　のんびり穏やかな一日となるでしょう！　　あなた様を邪魔するものは全てエリコが排除しますわ、クスクス♪", 591, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は小吉！　小さな勇気で踏み出す一歩が大事！\n遠くから見てるだけじゃダメ。今日は、少しだけ近づいてみます！", 592, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 593, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 594, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60005, 2, 1, 0, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 595, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60005, 2, 2, 0, "今日の運勢は小吉！　空を眺めると気持ちが晴れやかに！　　　　眺めるだけじゃなくて、ひとっ飛びしちゃいましょうかっ♪", 596, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 0, "", 0, 60005, 2, 2, 0, "今日の運勢は小吉！　掃除をすると運勢が開けそう！　　　　　　「わ、めんど」「ヴルムっ！　新年早々サボっちゃダメなんだからね！」", 597, "", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 190804, 60005, 3, 0, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 598, "", 2);
